Yesterday's #SuperBowlLV @AFGlobalStrike trifecta flyover took the efforts of dozens of airmen at four different bases to coordinate. For the team planning this historic event, however – the first flyover of a major sporting event featuring a B-1B Lancer, B-2 Spirit and B-52 Stratofortress – the flyover has taken months of hard work.

📹 by Tech. Sgt. Jensen Stidham

@NFL #AFflyover #AimHigh
